import React from 'react';
import {
  Box,
  UnorderedList,
  ListItem,
  ModalBody,
  Image,
  Button,
  useColorModeValue,
} from '@chakra-ui/react';

import { BsFileEarmarkCode } from 'react-icons/bs';

const CodeIt = () => {
  const firstColor = useColorModeValue('red', 'yellow');
  return (
    <Box mt={2}>
      <ModalBody>
        <Button colorScheme={firstColor} size="lg" mr={5}>
          Try Now
        </Button>
        <Button
          fontSize="xl"
          leftIcon={<BsFileEarmarkCode />}
          colorScheme="blue"
          size="lg"
        >
          View Source Code
        </Button>
        <br />
        <br />
        Hello, here is some content placeholer
      </ModalBody>
    </Box>
  );
};

export default CodeIt;
